const extractor=()=>({get_posts:async function(page=1,request=null,args=null){let url="https://www.koreaboo.com/news/";return page>=1&&(url="https://www.koreaboo.com/news/page/"+page+"/"),await fetch(url).then((res=>res.text())).then((str=>(new window.DOMParser).parseFromString(str,"text/html"))).then((dom=>[...dom.querySelectorAll("article")])).then((items=>items.map((item=>({title:item.querySelector(".ap-chron-medium-title").innerText,author:"Koreaboo",url:"https://www.koreaboo.com/news"+item.querySelector("a").pathname,id:item.querySelector("a").pathname,dt:item.querySelector("time").dateTime,image:item.querySelector("img").dataset.srcset.split(",").slice(-1)[0].split(" ")[0],page:"/discover/koreaboo"+item.querySelector("a").pathname})))))},get_post:async function(id,request=null,args=null){return null}});